/a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E5%88%98%E6%9E%97%E5%9F%8E------------/" target="_blank">刘林城</a>&nbsp;<a href="/s/-%E6%9C%B1%E4%B8%BD%E5%B2%9A------------/" target="_blank">朱丽岚</a>&nbsp;<a href="/s/-%E7%8E%8B%E6%B4%AA%E5%8D%83------------/" target="_blank">王洪千</a>&nbsp;<a href="/s/-%E7%8E%8B%E5%BB%BA%E5%9B%BD------------/" target="_blank">王建国</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E9%A1%B9%E7%A7%8B%E8%89%AF--------/" target="_blank">项秋良</a>&nbsp;<a href="/s/-----%E9%A1%B9%E6%B2%B3%E7%94%9F--------/" target="_blank">项河生</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/9/" target="_blank">科幻片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2020/" target="_blank">2020</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>男主水生胆小懦弱出，生在捕鱼家庭但因小时候和父亲一起捕鱼时被怪物“水猴子”杀害，留下心里阴影十年后怪物“水猴子”再次出现，杀害了女主香兰的弟弟和父亲。男主为了救女主不让被水猴子当“祭品”杀害。开始学习曾经父亲教他的捕鱼和水上技能。还邀请了自己表哥捕怪能上，一起加入。村民意识到自己的错误一同加入水生打</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/10701/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/85516/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-07-04/201907041562227357.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">7.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/85516/">深海大水怪</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E5%B8%95%E7%89%B9%E9%87%8C%E5%85%8B%C2%B7%E5%8D%9A%E9%87%91------------/" target="_blank">帕特里克·博金</a>&nbsp;<a href="/s/-%E4%B8%BD%E8%B5%9B%E7%89%B9%C2%B7%E5%AE%89%E4%B8%9C%E5%B0%BC------------/" target="_blank">丽赛特·安东尼</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E6%81%B0%E5%85%8B%E5%BA%B7%E7%B1%B3%E6%96%AF%E5%9F%BA--------/" target="_blank">恰克康米斯基</a>&nbsp;<a href="/s/-----%28Chuck--------/" target="_blank">(Chuck</a>&nbsp;<a href="/s/-----Comisky%29--------/" target="_blank">Comisky)</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/10/" target="_blank">恐怖片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E7%BE%8E%E5%9B%BD-----------/" target="_blank">美国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2001/" target="_blank">2001</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>葛斯伊根教授带著他的研究小组到苏格兰有名的尼斯湖去证明他对水怪的理论，他认为尼斯湖底部是某种古生物繁衍后代的温床，水怪并且利用凹槽连接至海边，作为它来去自如，藏匿自身的方式但在一次潜水行动中，教授因为不明原因而葬身湖底，所以他们派了凯斯霍尔来代替他的位置，继续做尼斯湖水怪的研究。&nbsp;　　凯斯</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/85516/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/83081/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-05-11/201905111557577088.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">4.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/83081/">鬼水怪谈[日版]</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E9%BB%91%E6%9C%A8%E7%9E%B3------------/" target="_blank">黑木瞳</a>&nbsp;<a href="/s/-%E8%8F%85%E9%87%8E%E8%8E%89%E5%A4%AE------------/" target="_blank">菅野莉央</a>&nbsp;<a href="/s/-%E5%B0%8F%E6%97%A5%E5%90%91%E6%96%87%E4%B8%96------------/" target="_blank">小日向文世</a>&nbsp;<a href="/s/-%E6%B0%B4%E5%B7%9D%E9%BA%BB%E7%BE%8E------------/" target="_blank">水川麻美</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E4%B8%AD%E7%94%B0%E7%A7%80%E5%A4%AB--------/" target="_blank">中田秀夫</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/10/" target="_blank">恐怖片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E6%97%A5%E6%9C%AC-----------/" target="_blank">日本</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2002/" target="_blank">2002</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>虽然渴望幸福美满的家庭，但松原淑美（黑木瞳 饰）和丈夫滨田邦夫（小日向文世 饰）的婚姻仍旧无可避免地走向破败边缘经过一番令人精疲力尽的拉锯战，淑美总算取得了5岁女儿郁子（菅野莉央 饰）的监护权。在此之后，母子二人通过中介搬到一所便宜、老旧的公寓，准备展开全新的人生。她们的生活起初充满快乐，但一切很快</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/83081/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/83080/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-05-11/201905111557574264.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">1.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/83080/">鬼水怪谈[美版]</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E8%A9%B9%E5%A6%AE%E5%BC%97%C2%B7%E5%BA%B7%E7%BA%B3%E5%88%A9------------/" target="_blank">詹妮弗·康纳利</a>&nbsp;<a href="/s/-%E7%BA%A6%E7%BF%B0%C2%B7C%C2%B7%E8%B5%96%E5%88%A9------------/" target="_blank">约翰·C·赖利</a>&nbsp;<a href="/s/-%E8%92%82%E5%A7%86%C2%B7%E7%BD%97%E6%96%AF------------/" target="_blank">蒂姆·罗斯</a>&nbsp;<a href="/s/-%E7%9A%AE%E7%89%B9%C2%B7%E6%B3%A2%E6%96%AF%E5%B0%94%E6%80%9D%E9%9F%A6%E7%89%B9------------/" target="_blank">皮特·波斯尔思韦特</a>&nbsp;<a href="/s/-%E9%98%BF%E7%91%9E%E5%B0%94%C2%B7%E7%9B%96%E5%BE%B7------------/" target="_blank">阿瑞尔·盖德</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-